import { useCroct } from '@croct/plug-react';
import React, {useState} from 'react';
import {Link} from 'react-router-dom'

function Inicio (){
   const croct = useCroct();
   const [count, setCount] = useState(0);
    croct.user.edit().clear('custom.persona').save();
   function load (){
      setCount(1);
   }
   console.log(count);
return (
  <div id="Page">
        <div id="titulo">
          <h1>Seja bem-vindo a Croct!</h1> 
        </div>
        <div id="introdution">
          <p>Dentre as opções abaixo, qual você mais se identifica?</p>
          <Link to="/developer">
             <button onClick={load}>Developer</button>
          </Link>
          <Link to="/marketer">
             <button  onClick={load}>Marketer</button>
          </Link>
          <Link to="/hacker">
             <button  onClick={load}>Growth-Hackers</button>
          </Link>
    </div>
   </div>
)}

export default Inicio;
